import re

def parseRoutes(code_snippet):
    routes = {}
    lines = code_snippet.split('')
    for line in lines:
        if line.strip().startswith('Route::get') and (not line.strip().startswith('//')):
            route_path = re.search("'(.*?)'", line).group(1)
            controller_method = re.search("\\[.*'(.*)'\\]", line).group(1)
            routes[route_path] = controller_method
    return routes

